@MajorTomGr &gt; ασθένειες που δε θα δει ποτέ στη ζωή του ή δεν το αφορούν (πχ ηπατίτιδα Β, σεξουαλικά μεταδιδόμενη ασθένεια και εμβολιάζονται τα βρέφη από το μαιευτήριο στις ΗΠΑ).
Με πλήρη ασυλία ξαναλέω των κατασκευαστών.
Δείτε σε τι τιμές αγοράζονται οι νέες δόσεις covid εμβολίων. 50% πάνω.

@MajorTomGr Δεν είμαι κατά των εμβολίων γενικά. Πχ τετάνου, MMR, BCG, κάποιων βασικών παιδικών.
Δυστυχώς η διαφθορά μεταξύ φαρμακευτικών και κυβερνήσεων οδηγεί σε πλήρη απαξίωση όλων των εμβολίων.
Το ότι οι φαρμακευτικές έχουν λάβει ασυλία για τα παιδικά εμβόλια είναι επίσης μεγάλο σκάνδαλο.

@MajorTomGr Το αποτέλεσμα της "συναλλαγής" κρατών με φαρμακευτικές είναι ότι τα προϊόντα δε μελετούνται επαρκώς.

"it took 22 years for researchers to establish that a seasonal influenza vaccine increased vaccinees' incidence/risk of non-flu infections"

https://t.co/9Kzy7UdxZQ

